import Navbar from './Navbar';
import  "bootstrap/dist/css/bootstrap.min.css"
import  "../styles/style.scss"

const Layout = (props) => (
   
    <div>
        <Navbar />

        <Link href="/listing/[id]" as={`/listing/${props.id}`}>
        <a>{props.id}</a>
        </Link>

        {
            props.children
        }
    </div>
)
export default Layout
